import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import './App.css';
import MazeGame from '../src/shared/MazeGame';
import Navigation from '../src/shared/NavBar';

function App() {
  return (
    <Router>
      <div className="App">
        <Navigation />
        <Switch>
          <Route path="/quotes">
            {/* Quotes page component goes here */}
          </Route>
          <Route path="/">
            <MazeGame />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
